import React, { useEffect, useState } from 'react';
import { getalbumData } from '../services/albumService';

const Dashboard = () => {
  const [albums, setAlbums] = useState([]);

  useEffect(() => {
    const fetchData = async () => {
      try {
        const data = await getalbumData();
        setAlbums(data);
      } catch (error) {
        console.error('Error fetching album data:', error);
      }
    };

    fetchData();
  }, []);

  return (
    <>

      <div>
        <h1>Dashboard</h1>
      </div>

      <div>
      <h1>Albums</h1>

        <ul>
          {albums.map((album) => (
            <li key={album.id}>{album.albumName}</li>
          ))}
        </ul>
      </div>


      <div>
      <h1>Artists</h1>

        <ul>
          {albums.map((album) => (
            <li key={album.id}>{album.albumName}</li>
          ))}
        </ul>
      </div>
    </>
  );
};

export default Dashboard;
